import { render, screen } from '@/tests/test-utils';

import { OnboardingForm } from '.';

jest.mock('next/navigation', () => require('next-router-mock'));

const integrations = [
  {
    id: '1',
    name: 'Hubspot',
    image:
      '',
    userId: null
  },
  {
    id: '2',
    name: 'Salesforce',
    image:
      '',
    userId: null
  }
];

describe('OnboardingForm', () => {
  it('should render the onboarding form in the integrations stage', () => {
    render(<OnboardingForm integrations={integrations} _currentStep={0} />);

    // TEST: Check if the onboarding form is rendered in integrations stage
    expect(screen.getByText(/Select your integrations/i)).toBeInTheDocument();
    expect(screen.getByRole('heading')).toHaveTextContent(/Select your integrations/i);

    expect(screen.getAllByRole('button')).toHaveLength(3);
    expect(screen.getByRole('button', { name: /Hubspot/i })).toBeInTheDocument();
    expect(screen.getByRole('button', { name: /Salesforce/i })).toBeInTheDocument();
    expect(screen.getByRole('button', { name: /Next/i })).toBeInTheDocument();

    expect(screen.getAllByRole('img')).toHaveLength(2);
    expect(screen.getByRole('img', { name: /Hubspot/i })).toBeInTheDocument();
    expect(screen.getByRole('img', { name: /Hubspot/i })).toHaveAttribute('alt', 'Hubspot');
    expect(screen.getByRole('img', { name: /Salesforce/i })).toBeInTheDocument();
    expect(screen.getByRole('img', { name: /Salesforce/i })).toHaveAttribute('alt', 'Salesforce');
  });

  it('should render the onboarding form in the extension stage', () => {
    render(<OnboardingForm integrations={integrations} _currentStep={1} />);

    // TEST: Check if the onboarding form is rendered in extension stage
    expect(screen.getByText(/Add the Coldry extension to your browser/i)).toBeInTheDocument();
    expect(screen.getByRole('button')).toHaveTextContent(/Dashboard/i);
  });
});
